    public static Color[][] InitSecondarySwatchData(CityLightsParameters parameters, PRNG prng)
    {
        var hatch = InitHatching(parameters);
        var cSwatch = InitSwatchData();

        var counts = new SortedDictionary<Element, int>();

        for (var i = 0; i < hatch.Length; i++)
        for (var j = 0; j < NumAuxColors; j++) // NUM_AUX_COLOURS = 64
        {
            var randomElement = (Element) RandomV1.Next(prng, 0, 7);

            var elementIndex = 0;

            switch (randomElement)
            {
                case Element.Fire: // FIRE 0-3
                    elementIndex = RandomV1.Next(prng, 0, 4);
                    UpdateCount(Element.Fire, counts);
                    break;
                case Element.Water: // WATER 4-7
                    elementIndex = RandomV1.Next(prng, 4, 8);
                    UpdateCount(Element.Water, counts);
                    break;
                case Element.Earth: // EARTH 8-11
                    elementIndex = RandomV1.Next(prng, 8, 12);
                    UpdateCount(Element.Earth, counts);
                    break;
                case Element.Wind: // WIND 12-15
                    elementIndex = RandomV1.Next(prng, 12, 16);
                    UpdateCount(Element.Wind, counts);
                    break;
                case Element.Wood: // WOOD 16-19
                    elementIndex = RandomV1.Next(prng, 16, 20);
                    UpdateCount(Element.Wood, counts);
                    break;
                case Element.Metal: // METAL 20-23
                    elementIndex = RandomV1.Next(prng, 20, 24);
                    UpdateCount(Element.Metal, counts);
                    break;
                case Element.Hologram: // HOLOGRAM 24-27
                    elementIndex = RandomV1.Next(prng, 24, 28);
                    UpdateCount(Element.Hologram, counts);
                    break;
            }

            // don't include black
            var index = RandomV1.Next(prng, 0, cSwatch[elementIndex].Length - 1);
            var color = cSwatch[elementIndex][index];
            hatch[i][index] = color;
        }


        foreach (var entry in counts.OrderByDescending(k => k.Value)) parameters.AdditionalElements.Add(entry.Key);

        return hatch;
    }

    private static void UpdateCount(Element element, SortedDictionary<Element, int> counts)
    {
        if (!counts.TryGetValue(element, out var count)) counts.Add(element, count = 1);
        counts[element] = count + 1;
    }
